// noinspection ES6PreferShortImport

import { keccak256 } from '@ethersproject/solidity'
import { INIT_CODE_HASHES } from './constants'

const mumbaiBytecode =
  ''

const arbitrumBytecode =
  ''

const arbitrumRinkebyBytecode =
  ''

// this _could_ go in constants, except that it would cost every consumer of the sdk the CPU to compute the hash
// and load the JSON.
const MUMBAI_COMPUTED_INIT_CODE_HASH = keccak256(['bytes'], [mumbaiBytecode])
const ARBITRUM_COMPUTED_INIT_CODE_HASH = keccak256(['bytes'], [arbitrumBytecode])
const ARBITRUM_RINKEBY_COMPUTED_INIT_CODE_HASH = keccak256(['bytes'], [arbitrumRinkebyBytecode])

describe('constants', () => {
  describe('INIT_CODE_HASH', () => {
    it('matches Mumbai computed bytecode hash', () => {
      expect(MUMBAI_COMPUTED_INIT_CODE_HASH).toEqual(INIT_CODE_HASHES[80001])
    })
    it('matches Arbitrum computed bytecode hash', () => {
      expect(ARBITRUM_COMPUTED_INIT_CODE_HASH).toEqual(INIT_CODE_HASHES[42161])
    })
    it('matches Arbitrum Rinkeby computed bytecode hash', () => {
      expect(ARBITRUM_RINKEBY_COMPUTED_INIT_CODE_HASH).toEqual(INIT_CODE_HASHES[421611])
    })
  })
})
